import React, { useState, useEffect } from 'react'

function DocTittleOne() {
    const [count, setCount] = useState(0);

     useEffect(() => {
         Document.title = ``
     },[count])

    return (
        <div>
            <button onClick={() => setCount(count + 1)}>Count - {count}</button>
        </div>
    )
}

export default DocTittleOne
